import React, { useState } from 'react';

function BookingForm({ onProceedToService }) {
  const [userName, setUserName] = useState('');
  const [userEmail, setUserEmail] = useState('');
  const [userPhone, setUserPhone] = useState('');

  const handleFormSubmit = (e) => {
    e.preventDefault();

    const userDetails = {
      userName,
      userEmail,
      userPhone
    };

    onProceedToService(userDetails);  // Call the function passed from App.jsx to proceed to the next stage
  };

  return (
    <form onSubmit={handleFormSubmit}>
      <div>
        <label>Name:</label>
        <input
          type="text"
          value={userName}
          onChange={(e) => setUserName(e.target.value)}
          required
        />
      </div>
      <div>
        <label>Email:</label>
        <input
          type="email"
          value={userEmail}
          onChange={(e) => setUserEmail(e.target.value)}
          required
        />
      </div>
      <div>
        <label>Phone:</label>
        <input
          type="tel"
          value={userPhone}
          onChange={(e) => setUserPhone(e.target.value)}
          required
        />
      </div>
      <button type="submit">Proceed to Service</button>
    </form>
  );
}

export default BookingForm;
